import React from 'react';

const AboutMe = () => {
    return (
        <section className="my-12">
            <h2 className="text-3xl font-semibold text-blue-600">Skills</h2>
            <p className="text-lg mt-4">
                Skills.
            </p>
        </section>
    );
};

export default AboutMe;
